    const {id}=useParams();
    const{data,isPending,error}=useFetch('https://localhost:8000/blogs/'+id);



    return ( 
    <div className="blog-details">
        <h2>Blog Details -{id}</h2>

    </div>
     );
}

export default BlogDetails;
